	function comp_locale(loc1, loc2) 
	{
		for (const prop in loc1) 
		{
			if (loc1[prop].toString() != loc2[prop].toString())
				return false;
		}
		return true;
	};

	function comp_locale_prop(loc1, loc2, prop)
	{
		if (loc1[prop] == loc2[prop])
		{
			return true;
		}
		if (loc1[prop] instanceof Array && loc2[prop] instanceof Array)
		{
			if (loc1[prop].toString() == loc2[prop].toString())
				return true;
		}
		return false;
	};

	function comp_locale_numBase(loc1, loc2)
	{
		if (!comp_locale_prop(loc1, loc2, "decimal_point")) return false;
		if (!comp_locale_prop(loc1, loc2, "thousands_sep")) return false;
		if (!comp_locale_prop(loc1, loc2, "grouping")) return false;
		if (!comp_locale_prop(loc1, loc2, "positive_sign")) return false;
		if (!comp_locale_prop(loc1, loc2, "negative_sign")) return false;
		if (!comp_locale_prop(loc1, loc2, "int_frac_digits")) return false;
		if (!comp_locale_prop(loc1, loc2, "frac_digits")) return false;
		return true;
	};
	function comp_locale_numOpt(loc1, loc2)
	{
		if (!comp_locale_prop(loc1, loc2, "p_cs_precedes")) return false;
		if (!comp_locale_prop(loc1, loc2, "p_sep_by_space")) return false;
		if (!comp_locale_prop(loc1, loc2, "n_cs_precedes")) return false;
		if (!comp_locale_prop(loc1, loc2, "n_sep_by_space")) return false;
		if (!comp_locale_prop(loc1, loc2, "p_sign_posn")) return false;
		if (!comp_locale_prop(loc1, loc2, "n_sign_posn")) return false;
		return true;
	};
	function comp_locale_curSym(loc1, loc2)
	{
		if (!comp_locale_prop(loc1, loc2, "int_curr_symbol")) return false;
		if (!comp_locale_prop(loc1, loc2, "currency_symbol")) return false;
		return true;
	};
	function comp_locale_curOpt(loc1, loc2)
	{
		if (!comp_locale_prop(loc1, loc2, "mon_decimal_point")) return false;
		if (!comp_locale_prop(loc1, loc2, "mon_thousands_sep")) return false;
		if (!comp_locale_prop(loc1, loc2, "mon_grouping")) return false;
		return true;
	};

