	return function (argc, argv)
	{
		var strstartlocale = "";
		var strendlocale = "";

		var strchange = "nexacro.Locale._locale_ref = {";

		var sourcepath = argv[0];
		var outpath = argv[1];

		print(" source path : " + sourcepath);
		print(" output path : " + outpath);

		var strreadfile = nexacro.__readFile(outpath);

		var idx = strreadfile.indexOf("nexacro.Locale._localeInfo_numData = [");
		strstartlocale = strreadfile.substring(0, idx);

		idx = strreadfile.indexOf(strchange) + strchange.length;
		strendlocale = strreadfile.substring(strreadfile.indexOf("};", idx) + 2, strreadfile.length);

		var data = LocaleInfoConvert();
		if (data)
		{
			print("====== Finish nexacro generation : Success " + data.length + " ======");
			data = strstartlocale + data + strendlocale;
		}
		else
		{
			print("====== Finish nexacro generation : Fail  ======");
			return;
		}

		nexacro.__writeFile(outpath, data);

	};

